    const images = ["https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ0mHiTzq7x4b3gG-8sp_9dAu76X-dRPzv0kXY8vef9Kg&s",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,"]

    return (
        <Card className="my-5">
            <div className="flex flex-row gap-4 overflow-y-auto py-3">
                {images.map(image => <PostItem imageSource ></PostItem>)}
            </div>
        </Card>
    );
};

export default RecommendItems;
